        def latlong(lat_pre):
            p = re.compile(r'\d\d\.\d+')
            m = p.match(str(lat_pre))

            if m:
                lat = round(lat_pre, 5)

            else:
                x = int(str(lat_pre)[:2])
                y = int(str(lat_pre)[2:4]) / 60
                z = float(str(lat_pre)[4:]) / 3600
                lat_dec = x + y + z
                lat = round(lat_dec, 5)
            latint= str(lat)[0:2]
            latdec= str(lat)[3:]
            return lat, latint, latdec



